import './styles.css';
import CharCard from '../CharCard';

const Characters = ({listCharacters}) => {



  return (
    <>

      <ul>

        {listCharacters.map((character,image, id) => (

          <CharCard character={character} key={id} />

        ))}

      </ul>

    </>
  )
}

export default Characters;
